CREATE TABLE IF NOT EXISTS "__EFMigrationsHistory" (
    "MigrationId" TEXT NOT NULL CONSTRAINT "PK___EFMigrationsHistory" PRIMARY KEY,
    "ProductVersion" TEXT NOT NULL
);

BEGIN TRANSACTION;

CREATE TABLE "Admins" (
    "Username" TEXT NOT NULL CONSTRAINT "PK_Admins" PRIMARY KEY,
    "Name" TEXT NULL,
    "Email" TEXT NULL,
    "Address" TEXT NULL,
    "Phone" TEXT NULL,
    "Picture" BLOB NULL,
    "Password" TEXT NULL,
    "SessionID" TEXT NULL
);

CREATE TABLE "AuditLogs" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_AuditLogs" PRIMARY KEY AUTOINCREMENT,
    "EntityName" TEXT NOT NULL,
    "Action" TEXT NOT NULL,
    "OriginalValues" TEXT NOT NULL,
    "CurrentValues" TEXT NOT NULL,
    "Timestamp" TEXT NOT NULL
);

CREATE TABLE "Users" (
    "Username" TEXT NOT NULL CONSTRAINT "PK_Users" PRIMARY KEY,
    "Name" TEXT NULL,
    "Email" TEXT NULL,
    "Address" TEXT NULL,
    "Phone" TEXT NULL,
    "Picture" BLOB NULL,
    "Password" TEXT NULL,
    "SessionID" TEXT NULL
);

CREATE TABLE "BankAccounts" (
    "AccountNumber" INTEGER NOT NULL CONSTRAINT "PK_BankAccounts" PRIMARY KEY AUTOINCREMENT,
    "AccountHolderName" TEXT NULL,
    "Balance" REAL NOT NULL,
    "UserUsername" TEXT NOT NULL,
    CONSTRAINT "FK_BankAccounts_Users_UserUsername" FOREIGN KEY ("UserUsername") REFERENCES "Users" ("Username") ON DELETE CASCADE
);

CREATE TABLE "Transactions" (
    "TransactionId" INTEGER NOT NULL CONSTRAINT "PK_Transactions" PRIMARY KEY AUTOINCREMENT,
    "FromAccountNumber" INTEGER NOT NULL,
    "ToAccountNumber" INTEGER NOT NULL,
    "Amount" REAL NOT NULL,
    "Timestamp" TEXT NOT NULL,
    "BankAccountAccountNumber" INTEGER NULL,
    "Description" TEXT NULL,
    CONSTRAINT "FK_Transactions_BankAccounts_BankAccountAccountNumber" FOREIGN KEY ("BankAccountAccountNumber") REFERENCES "BankAccounts" ("AccountNumber"),
    CONSTRAINT "FK_Transactions_BankAccounts_FromAccountNumber" FOREIGN KEY ("FromAccountNumber") REFERENCES "BankAccounts" ("AccountNumber") ON DELETE RESTRICT,
    CONSTRAINT "FK_Transactions_BankAccounts_ToAccountNumber" FOREIGN KEY ("ToAccountNumber") REFERENCES "BankAccounts" ("AccountNumber") ON DELETE RESTRICT
);

